import {makeStyles} from '@material-ui/core/styles'

export const useStyles = makeStyles((theme) => ({
    root: {
        '& div.top': {
            margin: '10px 0 70px'
        },
        '& div.bottom': {
            [theme.breakpoints.down('sm')]: {
                marginTop: '80px',
            },
            [theme.breakpoints.up('md')]: {
                marginTop: '10px',
            }
        },
    }
}))
